import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
import { BrowserRouter, Routes,Route } from 'react-router-dom';



import Message from './Message';

const Navbare = () => {
  return (
    <BrowserRouter>
      <div>
        <Navbar bg="light" expand="lg" fixed="top">
          <Container>
            <Navbar.Brand href="#" style={{color:'blue',fontSize:'40px',marginRight: '700px'}}>E-Tafa</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="me-auto">
                <NavLink to="/accueil" style={{color: 'black', fontSize:'20px',textDecoration: 'none', borderBottom: 'none',marginRight: '40px'}}>
                  Accueil
                </NavLink>
                <NavLink to="/message" style={{color: 'black',fontSize:'20px', textDecoration: 'none', borderBottom: 'none',marginRight: '40px'}}>
                  Message
                </NavLink>
                <NavLink to="/contact"style={{color: 'black',fontSize:'20px', textDecoration: 'none', borderBottom: 'none',marginRight: '40px'}}>
                  Contact
                </NavLink>
                <NavLink to="/apropos"style={{color: 'black',fontSize:'20px', textDecoration: 'none', borderBottom: 'none',marginRight: '40px'}}>
                  A propos
                </NavLink>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
       
      </div>
    </BrowserRouter>
  );
}

export default Navbare;
